">TUJUAN PEMBELAJARAN</span></strong></p>\\n\\n<p>⦁    Menjelaskan topologi jaringan komputer.<br />\\n⦁    Menentukan dan merancang topologi jaringan yang sesuai dengan kebutuhan.<br />\\n⦁    Menggunakan informasi topologi jaringan untuk troubleshooting.<br />\\n⦁    Menjelaskan model jaringan komputer dalam bentuk lapisan OSI.<br />\\n⦁    Menggunakan konsep model lapisan OSI dalam melakukan troubleshooting.<br />\\n⦁    Menjelaskan mekanisme pengiriman data dengan packet switching.<br />\\n⦁    Mengaplikasikan proses pendeteksian dan perbaikan kesalahan pada pengiriman data.<br />\\n⦁    Menjelaskan mekanisme transmisi data.<br />\\n⦁    Melakukan proses encoding data secara manual.</p>\\n\\n<p><br />\\n </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"986364f3-53c5-4b78-9735-bfc694e26ec7\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.16\",\"subContentId\":\"d104c83a-e233-4f03-a341-c1695590c404\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"TUJUAN PEMBELAJARAN\",\"authors\":[],\"changes\":[],\"extraTitle\":\"TUJUAN PEMBELAJARAN\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><span style=\\\"font-size:1.75em\\\"><strong>KATA PENGANTAR</strong></span></p>\\n\\n<p>Jaringan Komputer dan Internet adalah penemuan penting pada abad ke-20 yang mampu mengubah kehidupan manusia. Internet menjadi sumber informasi terbesar di dunia, kita sebagai pengguna internet dapat melakukan banyak kegiatan sehari-hari dengan mudah, efektif, dan efisien seperti: berbelanja, menonton film, mendengarkan musik, rapat, belajar bersama dengan guru atau teman-teman, dan masih banyak hal lainnya. Internet terbentuk dari jaringan komputer global yang mampu menghubungkan perangkat komputer, laptop, dan gawai yang dimiliki oleh seorang individu ke jaringan atau ke piranti lainnya. Internet melibatkan miliaran perangkat yang tersambung secara global dimana satu perangkat dapat meminta layanan ke perangkat lainnya. Di sisi lain, jaringan<br />\\nkomputer dengan skala kecil dan hanya dapat diakses secara lokal, biasa disebut dengan Local Area Network (LAN).</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6c137f9b-4cd8-4278-b323-0fbf80a622ad\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.16\",\"subContentId\":\"b91a7fec-6309-4502-a0e0-5f777f08b6e0\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"KATA PENGANTAR\",\"authors\":[],\"changes\":[],\"extraTitle\":\"KATA PENGANTAR\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><span style=\\\"font-size:1.5em\\\"><strong>TOPOLOGI JARINGAN</strong></span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">Koneksi antar komputer pada jaringan komputer baik dengan media kabel atau tanpa kabel, diatur sedemikian rupa membentuk sebuah konfigurasi jaringan. Konfigurasi jaringan dapat dipandang secara konfigurasi logical atau physical. Konfigurasi jaringan dibentuk dari topologi jaringan yang dapat direpresentasikan secara logical dengan bentuk lingkaran (node) dan garis pada graph. Pada konfigurasi fisik, node merepresentasikan komputer, switch, hub, atau peripheral lainnya, sedangkan garis adalah kabel penghubung atau komunikasi nirkabel.<br />\\nTopologi jaringan komputer memiliki banyak jenis yang dikembangkan dengan tujuan tertentu, dengan kelebihan dan kekurangan yang dimilikinya. Jenis-jenis topologi jaringan komputer tampak pada tabel berikut: </span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"daef3878-b96b-4fc4-b4ca-d90fa24893ef\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":fals an penerus sinyal ke semua komputer yang terhubung pada bus. Ketika akan berkomunikasi dengan topologi ini, komputer akan menentukan alamat komputer yang akan dituju dan kemudian mengirimkan data ke komputer tujuan. Komputer lain dapat mendeteksi sinyal dari komputer yang sedang berkomunikasi.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">Topologi bus ini cocok digunakan untuk daerah yang tidak terlalu luas. Setiap komputer (setiap simpul) akan dihubungkan dengan sebuah kabel komunikasi melalui sebuah interface. Setiap komputer dapat berkomunikasi langsung dengan komputer ataupun peralatan lainnya yang terdapat didalam network, dengan kata lain, semua simpul mempunyai kedudukan yang sama. Dalam hal ini, jaringan tidak tergantung kepada komputer yang ada dipusat, sehingga bila salah satu peralatan atau salah satu simpul mengalami kerusakan, sistem tetap dapat beroperasi. Setiap simpul yang ada memiliki address atau alam sendiri. Sehingga untuk meng-access data dari salah satu simpul, user atau pemakai cukup menyebutkan alamat dari simpul yang dimaksud</span></p>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Topologi Ring</span></strong></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">Pada jaringan ini terdapat beberapa peralatan saling dihubungkan satu dengan lainnya dan pada akhirnya akan membentuk bagan seperti halnya sebuah cincin. Jaringan cincin tidak memiliki suatu titik yang bertindak sebagai pusat ataupun pengatur lalu lintas data, semua simpul mempunyai tingkatan yang sama. Data yang dikirim akan berjalan melewati beberapa simpul sehingga sampai pada simpul yang dituju. Dalam menyampaikan data, jaringan bisa bergerak dalam satu ataupun dua arah. Walaupun demikian, data yang ada tetap bergerak satu arah dalam satu saat. Pertama, pesan yang ada akan disampaikan dari titik ketitik lainnya dalam satu arah. Apabila ditemui kegagalan, misalnya terdapat kerusakan pada peralatan yang ada, maka data yang ada akan dikirim dengan cara kedua, yaitu pesan kemudian ditransmisikan dalam arah yang berlawanan, dan pada akhirnya bisa berakhir pada tempat yang dituju. Konfigurasi semacam ini relative lebih mahal apabila dibanding dengan konfigurasi jaringan bintang. Hal ini disebabkan, setiap simpul yang ada akan bertindak sebagai komputer yang akan mengatasi setiap aplikasi yang dihadapinya, serta harus mampu membagi sumber daya yang dimilikinya pada jaringan yang ada. Disamping itu, sistem ini lebih sesuai digunakan untuk sistem yang tidak terpusat (decentralized-system), dimana tidak diperlukan adanya suatu prioritas tertentu.</span></p>\\n\\n<p><span style=\\\"font-size:1.5em\\\"><strong>Topologi Star</strong></span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">Dalam konfigurasi Star, beberapa peralatan yang ada akan dihubungkan kedalam satu pusat komputer. Kontrol yang ada akan dipusatkan pada satu titik, seperti misalnya mengatur beban kerja serta pengaturan sumber daya yang ada. Semua link harus berhubungan dengan pusat apabila ingin menyalurkan data kesimpul lainnya yang dituju. Dalam hal ini, bila pusat mengalami gangguan, maka semua terminal juga akan terganggu. Pada topologi star ada router/komputer yang bertindak sebagai komputer pusat. Semua komputer terkoneksi dengan router pusat. Komputer satu dapat berkomunikasi secara langsung dengan empat komputer lain melalui router pusat.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">Model jaringan bintang ini relative sangat sederhana, sehingga banyak digunakan oleh pihak per-bank-kan yang biasanya mempunyai banyak kantor cabang yang tersebar diberbagai lokasi. Dengan adanya konfigurasi bintang ini, maka segala macam kegiatan yang ada di-kantor cabang dapatlah dikontrol dan dikoordinasikan dengan baik. Disamping itu, dunia pendidikan juga banyak memanfaatkan jaringan bintang ini guna mengontrol kegiatan anak didik mereka.</span></p>\\n\\n<p><span style=\\\"font-size:1.5em\\\"><strong>Topologi Tree</strong></span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">Pada jaringan pohon, terdapat beberapa tingkatan simpul (node). Pusat atau simpul yang lebih tinggi tingkatannya, dapat mengatur simpul lain yang lebih rendah tingkatannya. Data yang dikirim perlu melalui simpul pusat terlebih dahulu. Misalnya untuk bergerak dari komputer dengan node-3 kekomputer node-7 seperti halnya pada gambar, data yang ada harus melewati node3, 5 dan node-6 sebelum berakhir pada node-7. Keungguluan jaringan model pohon seperti ini adalah, dapat terbentuknya suatu kelompok yang dibutuhkan pada setiap saat. Sebagai contoh, perusahaan dapat membentuk kelompok yang terdiri atas terminal pembukuan, serta pada kelompok lain dibentuk untuk terminal penjualan. Adapun kelemahannya adalah, apabila simpul yang lebih tinggi kemudian tidak berfungsi, maka kelompok lainnya yang berada dibawahnya akhirnya juga menjadi tidak efektif. Cara kerja jaringan pohon ini relatif menjadi lambat.</span></p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4786b335-7e7a-42ba-beb9-fb87f3bbd2da\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.16\",\"subContentId\":\"2b439946-d4ca-48ca-bd0d-cff5a2a789cf\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"TOPOLOGI JARINGAN\",\"authors\":[],\"changes\":[],\"extraTitle\":\"TOPOLOGI JARINGAN\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><strong><span style=\\\"font-size:1.5em\\\">MODEL JARINGAN</span></strong></p>\\n\\n<p>Rekayasa Jaringan Komputer seperti halnya konsep engineering pada umumnya, terdekomposisi atas banyak komponen penting yang membentuknya, yaitu: perangkat lunak, firmware, rekayasa chip, perangkat keras, dan sinyal listrik untuk komunikasi. Jaringan komputer dikembangkan dengan tujuan agar sebuah komputer (host) dapat berkomunikasi dengan komputer lain. Ketika akan berkomunikasi, dua komputer memerlukan protokol atau aturan tertentu, seperti juga manusia menggunakan bahasa tertentu untuk berkomunikasi. Untuk mempermudah pemahaman komunikasi antar komputer dalam jaringan jaringan yang kompleks, jaringan komputer dituliskan dalam model<br />\\njaringan komputer. Model jaringan komputer berisi protokol dan aturan yang digunakan untuk komunikasi. Model ini terbagi dalam bentuk tingkat/lapisan/layer abstraksi yang memiliki fungsi tertentu, seperti manusia yang memiliki beberapa sistem untuk menunjang kehidupannya yaitu kerangka tubuh, sistem pernafasan, sistem saraf, otot, dan lain sebagainya.</p>\\n\\n<p>Pada arsitektur model jaringan yang berlapis ini, suatu proses/ pekerjaan komunikasi antar komputer yang utuh dipecah dalam tugas tugas (task) kecil. Setiap tugas kecil akan dikerjakan oleh lapisan tertentu. Arsitektur model jaringan berlapis tampak pada Gambar. Setiap lapisan memiliki protokol dan aturan tersendiri, memiliki fungsionalitas khusus dan saling independen. Tiap tugas yang dikerjakan oleh lapisan pada komputer pengirim (host) juga akan dikerjakan oleh lapisan peer (peer layer) di komputer penerima (remote). Secara keseluruhan semua  fungsionalitas jaringan komputer dilaksanakan pada lapisan-lapisan ini. Keterkaitan antar lapisan diwujudkan dalam bentuk data yang diambil dari satu lapisan, di proses jadi output yang<br />\\ndikirimkan ke lapisan di bawahnya. Lapisan berikutnya pun melakukan hal yang sama. Pada lapisan paling bawah pada remote komputer proses dilakukan sebaliknya, output akan dikirim ke lapisan di atasnya.</p>\\n\\n<p>Setiap lapisan pada model jaringan ini memiliki protokol, metode, dan prosedur yang dibutuhkan untuk mengeksekusi tugas yang diberikan.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"3b71be21-d727-4031-89d1-f9b9f1301d5b\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":fal gAAJBlhAACSjDAAAElGGACAJCMMAECSEQYAIMkIAwCQZIQBAEgywgAABI1xBIpHfolUmC8MAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":706,\"height\":370},\"alt\":\"model osi\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8db52a98-457a-4b8b-b888-4408731a5b4f\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p><strong><span style=\\\"font-size:1.5em\\\">Application Layer:</span></strong></p>\\n\\n<p>Lapisan ini bertanggung jawab untuk menyediakan antarmuka ke pengguna aplikasi. Protokol yang digunakan pada lapisan ini adalah protokol yang berinteraksi langsung dengan pengguna, seperti hypertext transfer protocol (HTTP), file transfer protocol (FTP), domain name services (DNS), dan lain sebagainya. </p>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Presentation Layer:</span></strong></p>\\n\\n<p>Lapisan ini mendefinisikan format dan<br />\\nmentranslasikan data yang akan ditransmisikan oleh aplikasi melalui jaringan dari pengirim ke penerima. Protokol yang digunakan pada lapisan ini adalah Secure Socket Layer (SSL), Transport Layer Security (TLS), Remote Desktop Protocol (RDP), dan lain sebagainya.</p>\\n\\n<p><span style=\\\"font-size:1.5em\\\"><strong>Session Layer:</strong></span></p>\\n\\n<p>Lapisan ini mendefinisikan koneksi antar dua komputer saat dimulai, dipelihara, dan diakhiri yang disebut dengan sesi. Sebagai contoh, setelah otentikasi pengguna/ kata sandi selesai, komputer jarak jauh mempertahankan sesi ini untuk sementara waktu dan tidak meminta otentikasi lagi dalam rentang waktu tertentu. Contoh protokol pada lapisan ini adalah NetBIOS (IBM), Point-to-point Tunneling Protocol (PPTP), dan lain sebagainya.</p>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Transport Layer:</span></strong></p>\\n\\n<p>Lapisan ini bertanggung jawab untuk pengiriman end-to-end antara pengirim dan penerima, seperti<br />\\nmemecah data ke dalam paket-paket data, memberikan nomor urut ke paket-paket tersebut sehingga dapat disusun kembali pada komputer penerima. Selain itu, pada lapisan ini juga diciptakan acknowledgement sebagai penanda sukses tidaknya pengiriman data. Protokol pada lapisan ini adalah User Datagram Protocol (UDP) dan Transmission Control Protocol (TCP). Lapisan ini memiliki kemampuan transfer data yang andal dan transparan antara pengirim dan penerima. Lapisan ini juga melakukan multiplexing, pengendalian aliran, dan error checking data.</p>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Network Layer:</span></strong></p>\\n\\n<p>Lapisan ini bertanggung jawab untuk pengalamatan host pengirim dan penerima secara unik pada<br />\\njaringan. Protokol pada lapisan ini adalah Internet Protocol (IP) yang menciptakan IP Address, ARP, ICMP, dan lain sebagainya. </p>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Data Link Layer:</span></strong></p>\\n\\n<p>Lapisan ini bertanggung jawab untuk membaca dan menulis data dari dan ke jalur komunikasi,<br />\\nmengelompokkan data dalam frame, melakukan error checking dan correction, control flow,  melakukan pengalamatan perangkat keras (MAC Address). Lapisan ini juga menentukan  operasi perangkat jaringan seperti hub, switch, bridge, dan lain sebagainya pada level 2. Protokol pada lapisan ini seperti Pointto- Point Protocol (PPP), dan lain sebagainya.</p>\\n\\n<p><span style=\\\"font-size:1.5em\\\"><strong>Physical Layer:</strong></span></p>\\n\\n<p>Lapisan ini mendefinisikan perangkat keras pada transmisi jaringan seperti Network Interface Card (NIC), repeater, hub, dan lain sebagainya. Lapisan ini menentukan bagaimana cara sinkronisasi bit, arsitektur jaringan seperti Ethernet, topologi jaringan dan sistem pengkabelan. Pengiriman data dalam bentuk bit (biner) juga menjadi tanggung jawab lapisan ini, termasuk encoding. Protokol yang digunakan pada lapisan ini termasuk di dalamnya adalah: Ethernet, USB, Bluetooth, dan lain sebagainya.</p>\\n\\n<p>Contoh dari penggunaan lapisan OSI pada pengiriman data adalah sebagai berikut:</p>\\n\\n<ol>\\n\\t<li>Lapisan aplikasi menerima informasi yang akan dikirimkan dari pengguna, sebagai contoh pengiriman email.</li>\\n\\t<li>Informasi akan ditranslasikan dengan menggunakan protokol Simple Mail Transfer Protocol (SMTP) dengan cara aman (SSL) ke lapisan presentasi.</li>\\n\\t<li>Sesi pengiriman dari pengirim ke penerima akan diciptakan dan dipertahankan pada waktu tertentu melalui lapisan sesi. Informasi yang melewati tiga lapisan ini disebut dengan Protocol Data Unit (PDU).</li>\\n\\t<li>Lapisan transport akan mentransformasi data ke bentuk lain yang disebut dengan segmen.</li>\\n\\t<li>Segmen akan ditransformasikan menjadi packet data pada lapisan jaringan. </li>\\n\\t<li>Pada lapisan data link, packet data akan diubah menjadi frame.</li>\\n\\t<li>Frame selanjutnya akan mengalir ke lapisan physical dan diubah menjadi format bit, dan ditransmisikan dalam bentuk aliran bit (bit stream) arus listrik, gelombang  elektromagnetik, gelombang cahaya, dan sebagainya.</li>\\n\\t<li>Proses transformasi dari satu lapisan ke lapisan berikutnya dilakukan dengan penambahan header khusus dengan proses enkapsulasi yang dilakukan berulang yang kemudian dikirim ke penerima melalui media transmisi pada jaringan.</li>\\n\\t<li>Setelah data sampai di penerima, proses yang terjadi adalah kebalikannya. Bit stream akan diubah menjadi informasi, header akan dibuang satu persatu dari lapisan terbawah ke lapisan di atasnya yang disebut proses deenkapsulasi.</li>\\n</ol>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Transmission Control Protocol/Internet Protocol (TCP/IP)</span></strong></p>\\n\\n<p>TCP/IP adalah protokol dan standar komunikasi data yang digunakan pada jaringan internet. Protokol ini merupakan protokol yang paling banyak digunakan. Protokol TCP/ IP dikembangkan pada awal 1980-an sebagai protokol yang menghubungkan komputer-komputer dan jaringan<br />\\nyang membentuk jaringan internet yang luas (WAN). TCP/ IP membentuk jaringan terbuka dan independen terhadap mekanisme transport jaringan fisik yang digunakan. TCP/IP menggunakan cara pengalamatan sederhana yang dinamakan IP address yang dapat menghubungkan jutaan<br />\\nkomputer dengan sistem yang heterogen (seperti Windows, UNIX, Linux, dan lain-lain). Protokol TCP/IP merupakan kumpulan protokol (protocol suite) yang terdiri atas banyak protokol yang didukung perangkat lunak yang biasa disebut TCP/IP stack.</p>\\n\\n<p>Keunggulan TCP/IP adalah standar protokol yang terbuka, sehingga tersedia secara bebas dan dikembangkan independen terhadap perangkat keras komputer maupun sistem operasi<br />\\napapun. Karena didukung secara meluas, TCP/IP sangat ideal untuk menyatukan bermacam perangkat keras dan perangkat lunak, walaupun tidak berkomunikasi lewat internet. <br />\\nContoh dari penggunaan Cara Kerja TCP/IP adalah pengiriman data antara komputer pengirim dan penerima dalam suatu jaringan yang memiliki banyak komputer diperlukan alamat tujuan dan perantara untuk perjalanan bit stream yang akan dikirimkan. Internet protocol (IP) akan menjamin data sampai ke tempat tujuan secara aman dan tepat. Saat seorang pengguna internet mengirim data ke komputer lain, protokol TCP/IP mulai diikuti. TCP membagi data menjadi paket-paket<br />\\ndata kecil, menambahkan beberapa informasi untuk error checking, dan IP menambahkan label yang berisikan informasi alamat pada paket tersebut.</p>\\n\\n<p>Paket-paket data dalam bentuk bit stream dikirim menuju perangkat tujuan yang dapat melalui jalur yang berbeda. Perangkat perantara seperti router dapat digunakan untuk mencari jalur tercepat menuju perangkat tujuan. Router juga digunakan untuk membantu pengaturan beban lalu lintas<br />\\njaringan sehingga beban dapat terbagi rata. Saat paket-paket data dengan TCP/IP sampai pada perangkat<br />\\ntujuan, alamat IP akan dibuka dari daftar pengiriman. Paket data akan disusun kembali sesuai dengan urutan jika paket data tidak corrupted. Saat perangkat penerima mengetahui ada data yang corrupted, perangkat akan meminta kiriman data ulang. Pada TCP/IP juga terdapat  perangkat khusus yang disebut gateway yang memungkinkan berbagai  tipe jaringan berkomunikasi dengan internet. Internet menjadi jaringan global. Ayo</p>\\n\\n<p> </p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"91058c72-bac0-4f45-b8cf-fcdc759eff89\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.16\",\"subContentId\":\"c4675254-6f9a-4baf-bca4-86ffe205d82a\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"MODEL JARINGAN\",\"authors\":[],\"changes\":[],\"extraTitle\":\"MODEL JARINGAN\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><strong><span style=\\\"font-size:1.5em\\\">TRANSMISI DATA</span></strong></p>\\n\\n<p>Transmisi data adalah proses penting pada jaringan komputer dan internet. Ketika kita mengirimkan email atau mengakses situs web dan kita mendapatkan informasi maka terjadi transmisi data. Transmisi data adalah proses berbagi atau bertukar data antara dua objek, alat, atau sistem.  Komunikasi data memiliki bagian penting yaitu pengirim yang melakukan proses pengiriman data, penerima yang menerima data, dan medium/kanal yang merupakan saluran transmisi dari data<br />\\natau informasi dari dua objek berbeda tersebut. Bagian penting dari komunikasi data dapat dilihat pada gambar di bawah. </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d9db057f-86c4-4579-a764-1a2bec01cb89\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAA  kemudian bisa dikirimkan melalui jalur  yang berbeda-beda. Paket data ke-i, misalnya dapat melalui jalur X, namun kemudian jika suatu jalur X menjadi sangat sibuk, maka paket ke-i+1 dapat melewati jalur lain menuju tujuan dari pengiriman paket. Sama seperti ketika kurir akan mengirimkan paket belanja daring yang kita beli, tentu kurir akan mencari jalur tercepat untuk sampai ke rumah kita. Metode dengan memecah paket dalam bentuk paket-paket kecil ini sebenarnya memiliki kelemahan, yaitu dengan adanya proses penyusunan kembali paket-paket data tersebut (reassemble). </p>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Struktur Paket</span></strong></p>\\n\\n<p>Paket terdiri atas tiga bagian penting, yaitu: packet header, packet payload, dan packet trailer. Packet header adalah alamat paket ketika suatu paket akan dikirimkan ke tujuan tertentu. Packet<br />\\npayload adalah paket data sebenarnya yang berisi informasi yang ditransmisikan dari sumber ke tujuan, sedangkan packet trailer berisi informasi penutup dari suatu paket data yang menandakan paket berakhir. Packet trailer dapat berisi protokol untuk pengecekan terjadinya pengiriman data. Gambar menunjukkan contoh struktur paket data.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"454dbfdf-ae58-45d5-845d-a1e0979d018c\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA98AAAEnCAYAAACwrfDtAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7P13mBVV1veNv9f1/vFLz/089zv3PTP3jIlM0znnQM5ZEVFAURSzAkZEgkoOkgQlN6EDqckZmtA5npxjn9M5N9Ak4ftba59uaLB1dIQRx736+l51TtWuXWvvqq5Tn1o7/F+QJk2aNGnSpEmTJk2aNGnSpD1Uk/AtTZo0adKkSZMmTZo0adKkPWST8C1NmjRp0qRJkyZNmjRp0qQ9ZJPwLU2aNGnSpEmTJk2aNGnSpD1kk/AtTZo0adKkSZMmTZo0adKkPWST8C1NmjRp0qRJkyZNmjRp0qQ9ZJPwLU2aNGnS n<ul>\\n\\t<li>Alamat IP pengirim</li>\\n\\t<li>Alamat IP penerima (tujuan)</li>\\n\\t<li>Urutan paket yang digunakan untuk penyusunan kembali paket saat sampai di tujuan</li>\\n\\t<li>Ukuran paket yang digunakan untuk menentukan apakah paket utuh ketika sampai di node, termasuk juga informasi banyaknya paket yang ditransmisikan.</li>\\n</ul>\\n\\n<p>Lalu untuk Packet payload berisi:</p>\\n\\n<ul>\\n\\t<li>Data aktual yang dikirimkan yang biasanya sebesar 64KiB. </li>\\n</ul>\\n\\n<p>Dan terakhir Packet trailer berisi:</p>\\n\\n<ul>\\n\\t<li>Cara untuk mengidentifikasi akhir paket</li>\\n\\t<li>Cara untuk mengecek kesalahan pengiriman, beberapa</li>\\n\\t<li>Cara antara lain Cyclic Redundancy Check (CRC), Checksum, dll.</li>\\n</ul>\\n\\n<p><strong><span style=\\\"font-size:1.5em\\\">Packet Switching</span></strong></p>\\n\\n<p>Packet switching adalah salah satu cara transmisi paket data yang paling banyak digunakan, dimana data akan dipecah ke dalam beberapa paket data dan dikirimkan secara independen<br />\\ndari titik awal ke titik tujuan. Sesampainya di tujuan paketpaket data tersebut akan disusun kembali dengan urutan yang sesuai dengan menggunakan informasi yang ada pada header packet. Pada setiap tahapan pengiriman data akan sampai pada node yang berisi router, yang akan melanjutkan proses pengiriman ke tujuan. Sebagai contoh misalnya kalian sedang mengirimkan sebuah surel yang berisi foto kalian dari laptop kalian ke ponsel milik teman kalian. Surel dan foto tersebut akan<br />\\ndipecah dalam beberapa paket data sebelum dikirimkan.</p>\\n\\n<p>Paket-paket data akan dikirim melalui jalur atau rute dari komputer A ke komputer B, melalui node yang bisa berupa router, switch, komputer, dan lain sebagainya. Ketika sebuah paket data dikirimkan dan mencapai suatu node tertentu, node akan mengirimkan paket tersebut sesuai dengan packet header yang ada pada paket tersebut. Sebagai contoh pada Gambar paket data yang dikirimkan dari komputer A akan melalui jalur yang independen untuk sampai ke komputer B.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"53c80673-dd88-4b7a-8698-72518fa8a634\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAxgAAAF4CAYAAADXFl8XAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7J0HWFVX9va/Z/7TM+l9Uid1JslMMom9d6xYAEWkSJHemzRBQAERAakWVOy999577723aNT0mEzK+va77j1X0Kte4Yr3wvo9z3qUc/bZp95z1rv3Wnv/PxIEQRAEQRAEQTATIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAEQRAEQTAbIjAEQRAsiF9++YV+/PFHMTExsUrZzz//rH+rCELVIwJDEATBgli1ahV5eHpS127dxMTExCpkPRwdqaCwUP9WEYSqRwSGIAiCBaEJDIfu9tSrVw9ydXUUExMTM8mcXRyVuHAQgSE8ckRgCIIgWBCawIiP8aWVCzPo+L5iMTExMZNs+/ocyhsSIQJDeOSIwBAEQbAgNIGRkhRA+7bn0Y9fTxATExMzyS6cHEmjhsWIwBAeOSIwBEEQLAgRGGJiYhU1ERiCpWARAuPLH/5H+y98Q7vPfl097NzXdOzKd/qzEwRBMB0RGGJiYhW1mi4wfvvyK/r1ypXqY1e/oN9u3tSfnXVhEQIjZvYRqp2+gT5OXV9trH7mRtqrRJMgCMKDIAJDTEysolaTBQbExc3JU+nm2PHVx8ZPpJ9WrNKfoXVhEQKj16jd9GrsSvo4eDzVCRhh1fZZ4Ch6N3w2vRm/mpYc/EJ/hoIgCKYhAkNMTKyiVpMFxq+XLtEPI0fRhdw82pQygNYmJVu17RiQRj8MG0E/zpmrP0PrwiIERs+Ru1hgOEbnUv7EBTRu0SartNIF62nwuIVU16+Y3ohfRYsOXNWfoSAIgmmIwBATE6uo1WiBcfEiC4yNyam0pmQ07Zw5l/bOXWCVtnbcJJrcP0UnMGbP0Z+hdWFRAsMnMZdWbt9HBy7esErbd+4qzVu/hxr6 jx89ood371LGzRvZ4v1bt+hRRoZuL4L8xMHYWOrbty+VKFGCfv/990JN/EaUnI2JidH9eoFAIBDkB0RIEAgEAoFAILBiXLp0iTZu3Ejjxo0jX1/fQs3x48dTaGgoXbx4UffrBQKBQJAfECFBIBAIBAKBQCAQCAQCQZYhQoJAIBAIBAKBQCAQCASCLEOEBIFAIBAIBAKBQCAQCARZhggJAoFAIBAIBAKBQCAQCLIMERIEAoFAIBAIBAKBQCAQZBkiJAgEAoFAIBAIBAKBQCDIIoj+P5qCZcp9QV/lAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":1042,\"height\":428},\"alt\":\"pengiriman paket data 2\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b2b0d68a-3b47-4944-b48d-3282549ac3f7\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>Metode packet switching dianggap sebagai salah satu cara yang andal, namun cara ini juga memiliki kelebihan dan kekurangan. Beberapa kelebihan cara ini adalah:</p>\\n\\n<ol>\\n\\t<li>Paket data dapat dikirimkan dari sumber ke tujuan tanpa jalur khusus (dedicated channel)</li>\\n\\t<li>Kegagalan pengiriman rendah, karena router dapat melakukan pengiriman ulang (rerouting) paket jika terjadi kegagalan.</li>\\n\\t<li>Banyak user bisa menggunakan jaringan yang sama.</li>\\n\\t<li>Memungkinkan pengiriman data kecepatan tinggi.</li>\\n</ol>\\n\\n<p>Namun packet switching juga memiliki beberapa kekurangan, di antaranya adalah:</p>\\n\\n<ol>\\n\\t<li>Paket data bisa hilang dan harus dikirimkan kembali.</li>\\n\\t<li>Proses menyusun kembali paket data yang membutuhkan waktu.</li>\\n\\t<li>Adanya delay (jeda) dan rentan terhadap error sehingga sulit digunakan untuk pengiriman data yang cepat dan berkualitas tinggi seperti voice call.</li>\\n</ol>\\n\\n<p>Terkadang paket data pada packet switching hilang di perjalanan karena bouncing data (data yang berpindah-pindah) di antara router dan akhirnya tidak sampai di tujuan atau penerima data. Proses pengiriman akan berhenti yang dapat menyebabkan jaringan terhenti karena meningkatnya paket yang hilang. Untuk mengatasi hal itu, muncul teknik yang disebut dengan metode hopping. Hop number (penghitung hop) atau Time to Leave (TTL) akan diberikan pada header pada setiap paket data, dan penghitung ini akan dikurangi satu setiap kali paket data meninggalkan router. Awalnya paket data diberi penghitung hop maksimum. Jika penghitung hop sudah nol dan paket data tidak<br />\\nsampai pada tujuannya maka paket data tersebut dihapus dari router berikutnya. Paket yang hilang ditandai oleh komputer penerima dan permintaan untuk pengiriman ulang paket data<br />\\ndiciptakan. Ilustrasi mengenai hopping tampak pada Gambar</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f01da320-4e51-466f-9b90-3d1924c84b98\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA+AAAABvCAYAAABsKartAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAGeDSURBVHhe7Z0FeFTn8v/7s//P3eXe9t7bW1da2kKF4k6RthQoRQoUh+JQ3N3dneIEgkMSQpDg7tLi3kKF+vufz+yesFk2EAgke9L5Ps88kN2zx9458853Zt45DziDwWAwGAwGg8FgMBgM9x1GwA0Gg8FgMBgMBoPBYMgEGAE3GAwGg8FgMBgMBoMhE2AE3GAwGAwGg8FgMBgMhkyAEXCDwWAwGAwGg8FgMBgyAUbADQaDwWAwGAwGg8FgyAQYATcYDAaDwWAwGAwGgyETYATcYDAYDAaDwWAwGAyGTIARcIPBYDAYDAaDwWAwGDIBNxHw69e+cweSjruN83e7DXN2mmQTOZT8ufvqyrfBUc4e2Jt4zG1dvD/i9Zr4U/auOerOHLoYHGGDwZCZ+Pmnn93u+MMueZ7N/9lJ9iYedVcvfh0c5eyB6199545sPhHxek38Kwc3fKZjm53wtfjeB9YfdxtmR75mE/9J8oI9oqufu19++SU4yneOVAScHX157pqLn7DZLegV7+b1iBNZbeJ7iXOJ07a5iye+CI60/4Gurhqb7GIHJer1Rb5uE/8IYxjnVo7Z6HYsPxgc5eyBn3782X339ffuq8vfiHxrkk0Ep4qxzcD8G1XApn577TsXN36TW9Db5v/sIQG7Gj9pi/ts15ngSGcPXL3wlVs7fWvwGiNdu4kfJX7SZnflzNXgKGcDyPxw5tAFlzRje/AaTV/9L3EyRya49bN3up9/ukcEnOj3hc+/cAv7rtEJGJnfK87N72niS2HsRBjHxYMTs01mEUfxx+9/StFR09NsIL1ujOUqIeHZCZdOfOm2LNrn5nRdKbLKJJvI/O6r3Pnjl9UWZQcw/1/8/IpbMXrjDbsa6Vk18YcE535kxagNWi2WXYJF4PLJL8VXDZn/zQfwrwTHz9PXE3vOqT3KDsBf3Z9 n style=\\\"background-color:#ecf0f1\\\">memabca dngan baik.</span><br />\\n<span style=\\\"background-color:#ecf0f1\\\">Hal ini dikanarekan oatk manuisa membcaa ktaa secraa utuh tiadk</span><br />\\n<span style=\\\"background-color:#ecf0f1\\\">dengan setaip huurfnya.</span><br />\\n<span style=\\\"background-color:#ecf0f1\\\">Menakjbukan buakn?</span></span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">Bagaimana, apakah kalian dapat membaca contoh teks tersebut? Contoh teks diatas mungkin dapat dibaca dan dimengerti oleh sebagian besar orang, namun ternyata tidak demikian dengan komputer. Data yang berubah atau  terkorupsi (corrupted) sering ditemukan pada pengiriman data seperti pada contoh teks di atas. Oleh sebab itu pengecekan kesalahan sangat penting di teknologi informatika. Adapun bentuk-bentuk kesalahan yang dapat terjadi pada pengiriman data, yaitu:</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"899299b3-9338-45be-b824-07d7143e1033\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA3UAAAHhCAYAAADJZpdcAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAALE5SURBVHhe7b15fBRV3u///H2vzzMzz3bvc3/3uThsCoOKODiMOjAqCrigw+AG7oooIqKi4IaOgjOiEoMMDKCACCj7HpQlAQwkBMMOSdiRhEUJkISwZPv86lTX6T5dqequ6q6kq8jn/Xp9X+k+Vef0p+qkuurTZ/snEEIIIYQQQggJLDR1hBBCCCGEEBJgaOoIIYQQQgghJMDQ1BFCCCGEEEJIgKGpI4QQQgghhJAAQ1NHCCGEEEIIIQGGpo4QQgghhBBCAgxNHSGEEEIIIYQEGJo6QgghhBBCCAkwNHWEEEIIIYQQEmBo6gghhBBCCCEkwNDUEUIIIYQQQkiAoakjhBBCCCGEkABDU0cIIYQQQgghAYamjhBCCCGEEEICDE0dIYQQQgghhAQYmjpCCCGEEEIICTA0dYQQQgghhBASYGjqCCGEEEIIISTA0NSRJLmA06XnUWe8I4QQQgghhDQuNHUeUXfuGA4UFWHPgVJUqA6nah82ff4UHpxehGojKYrq3Vj7cQ/c3PxytOz8HF7JPo5aY5PvqD6J4m0rsWbhZ/jHyAF4vd/NuO2KVug8bZ9/NSdCkOokTA3OH1mGWUOfxDubK4w0QgghhBDSFGggU1eH2tJ9OJb2Bba2/Rib iman data\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"875a887f-2e7b-47d2-a156-63f83bd0640b\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>Kesalahan yang terjadi pada proses pengiriman data tersebut dapat dikendalikan dengan dua cara, yaitu:<br />\\na. Pendeteksian Kesalahan. </p>\\n\\n<p>Pendeteksian kesalahan merupakan salah satu cara yang ampuh dalam mengendalikan kesalahan ketika proses pengiriman paket data. Ada beberapa cara untuk pendeteksian kesalahan pada<br />\\npengiriman data, diantaranya yaitu:<br />\\n1. Parity Check<br />\\n2. Checksum<br />\\n3. CRC (Cyclic Redundancy Check)</p>\\n\\n<p>1) Parity Check<br />\\nParity check adalah salah satu metode untuk mengecek apakah data yang ditransmisikan sesuai dengan aslinya. Metode ini menggunakan perhitungan banyaknya bit 1 pada data yang dikirimkan. Parity check dapat menggunakan parity genap atau gasal. Parity genap menggunakan aturan banyaknya bit 1 harus genap sedangkan parity ganjil menggunakan aturan banyaknya bit 1 pada data harus ganjil. Parity check diletakkan sebagai tambahan bit pada data yang akan dikirim, yang biasanya di bit paling kiri (most significant bit), yang biasa disebut dengan parity bit. Sebelum proses pengiriman data, pengirim dan penerima data harus sepakat jenis parity mana yang digunakan. Hal ini disebut dengan protokol transmisi.</p>\\n\\n<p>Parity check berguna ketika kesalahan pengiriman data hanya muncul pada satu bit, namun ketika kesalahan terjadi pada dua bit data, maka parity check tidak dapat mendeteksinya. Sebagai contoh jika data berubah pada dua bit ke 5 dan 6, maka banyaknya bit 1 masih genap dan<br />\\ndata dianggap tidak salah. Data dikirimkan menggunakan parity genap dan berubah ketika diterima, namun masih memenuhi parity genap.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"li 8-ceac-4363-92e4-3d17abcb9d0c\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>Pengembangan dari parity check selanjutnya adalah checksum. Checksum akan dibahas pada sub bab berikutnya. Pendeteksian kesalahan pada parity check masih memiliki kekurangan dimana metode ini belum dapat menemukan dimana tepatnya atau bit ke berapa dari data yang corrupted. Metode ini selanjutnya dikembangkan dengan menggunakan parity block atau memberikan tambahan parity byte. </p>\\n\\n<p>Contoh pada tabel berikut, data sebanyak 9 byte dikirimkan dari pengirim ke penerima. Pengirim dan<br />\\npenerima bersepakat menggunakan parity genap Kesepakatan juga dilakukan untuk mengirimkan parity byte yang berfungsi sebagai sebagai parity bit vertikal yang dapat digunakan untuk memastikan bit mana yang salah.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9cea390d-b168-49fe-8e4c-f042f2fd6345\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAngAAAHjCAYAAACw3mInAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAHvESURBVHhe7b3tb1tXnueZP8JvCnlRwebFRjYMLLwoJMgAwWCDajjaghBka9+07a5gkqDdhRVgI4VCBjJcqKCSMGXEjhQbwmY6Jicpb9tWSXLXSONYsSK5E0oVOoKVOEpk+gm2Hl3pmcCtaaTdNerf3nN5H348/JEixXMfdM/3C3wBm5cU+fvw3MMvz8PlQwRBEARBEARlSgh4EARBEARBGRMCHgRBEARBUMaEgAdBEARBEJQxIeBBEARBEARlTAh4EARBEARBGRMCHgRBEARBUMaEgAdBEARBEJQxIeBBEARBEARlTAh4EARBEARBGRMCHgRBEARBUMbUdMB76OwgDMMwDMMwHJPbEQIeDMMwDMNwCt2OEPBgGIZhGIZT6Ha06YAHtSfbWfL6wQAMwAAMwAAMwMAsAwS8hGQ7S14/GIABGIABGIABGJhlgICXkGxnyesHAzAAAzAAAzAAA7MMEPASku0sef1gAAZgAAZgAAZgYJYBAl5Csp0lrx8MwAAMwAAMwAAMzDJAwEtItrPk9YMBGIABGIABGICBWQYIeAnJdpa8fjAAAzAAAzAAAzAwywABLyHZzpLXDwZgAAZgAAZgAAZmGSDgJSTbWfL6wQAMwAAMwAAMwMAsAwS8hGQ7S14/GIABGIABGIABGJhlgICXkGxnyesHAzAAAzAAAzAAA7MMEPASku0sef1gAAZgAA aan pengiriman data ulang akan dikirimkan.</li>\\n</ol>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"315cf4b7-f22b-4254-b499-7585daf7993d\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.16\",\"subContentId\":\"56a2d68c-a06b-4b77-9dbf-1cf0cccaa55b\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"TRANSMISI DATA\",\"authors\":[],\"changes\":[],\"extraTitle\":\"TRANSMISI DATA\"}}],\"behaviour\":{\"baseColor\":\"#1768c4\",\"defaultTableOfContents\":true,\"progressIndicators\":true,\"progressAuto\":true,\"displaySummary\":true},\"read\":\"Read\",\"displayTOC\":\"Display 'Table of contents'\",\"hideTOC\":\"Hide 'Table of contents'\",\"nextPage\":\"Next page\",\"previousPage\":\"Previous page\",\"chapterCompleted\":\"Page completed!\",\"partCompleted\":\"@pages of @total completed\",\"incompleteChapter\":\"Incomplete page\",\"navigateToTop\":\"Navigate to the top\",\"markAsFinished\":\"I have finished this page\",\"fullscreen\":\"Fullscreen\",\"exitFullscreen\":\"Exit fullscreen\",\"bookProgressSubtext\":\"@count of @total pages\",\"interactionsProgressSubtext\":\"@count of @total interactions\",\"submitReport\":\"Submit Report\",\"restartLabel\":\"Restart\",\"summaryHeader\":\"Summary\",\"allInteractions\":\"All interactions\",\"unansweredInteractions\":\"Unanswered interactions\",\"scoreText\":\"@score / @maxscore\",\"leftOutOfTotalCompleted\":\"@left of @max interactions completed\",\"noInteractions\":\"No interactions\",\"score\":\"Score\",\"summaryAndSubmit\":\"Summary &amp; submit\",\"noChapterInteractionBoldText\":\"You have not interacted with any pages.\",\"noChapterInteractionText\":\"You have to interact with at least one page before you can see the summary.\",\"yourAnswersAreSubmittedForReview\":\"Your answers are submitted for review!\",\"bookProgress\":\"Book progress\",\"interactionsProgress\":
